import React from "react";
//Components
import ProjectInvolves from "./Project_involves/ProjectInvolves";
import Plannings from "./Planning/Planning";
const AboutProject = () => {
  return (
    <div className="about-project">
      <h3>AboutProject</h3>
      <ProjectInvolves />
      <Plannings />
    </div>
  );
};

export default AboutProject;
